import React from "react";

import { styled } from "styled-components";

const DoneButton = styled.button`
  backgroun-color: #5e6be5;
`;

const DoneFail = () => {
  return (
    <div>
      <Button type="primary">&nbsp;</Button>
    </div>
  );
};

export default DoneFail;
